import React from "react";
import Dropdown from "./DropDown";

function Controls(props){
  
  function handleDifficulty(e){
    console.log(e.target.id)
    if(e.target.id === "easy"){
      props.SetDifficultyLevel(1);
    } else if (e.target.id === "medium"){
      props.SetDifficultyLevel(2);
    } else if(e.target.id === "hard"){
      props.SetDifficultyLevel(3);

    }
    console.log(props.difficultyLevel)
    
  }

  function inputKeys(){
    return(
      <div className="inputContainer">
        <div className="inputKey">1</div>
        <div className="inputKey">2</div>
        <div className="inputKey">3</div>
        <div className="inputKey">4</div>
        <div className="inputKey">5</div>
        <div className="inputKey">6</div>
        <div className="inputKey">7</div>
        <div className="inputKey">8</div>
        <div className="inputKey">9</div>
        <div className="inputKey">erase</div>
      </div>
    )
  }
  let inputkeyList = inputKeys();
  return(
    <div className="control">
    <div className="dropdownContainer">
    <Dropdown handleDifficulty={handleDifficulty}/>
  </div>  
    {inputkeyList}
    </div>
  )
}

export default Controls;
